import React, { Component } from "react";
import HeaderMarket from './headerMarket';
import "./deposit.css";
import 'bootstrap/dist/css/bootstrap.css';
import {Container,Form} from 'react-bootstrap';
import Button from 'react-bootstrap/Button';
import { FaWallet,FaSignal } from "react-icons/fa";
export default class EtherDeposit extends Component{
    render(){
        return(
            <>
                <div>
                    {<HeaderMarket />}
                </div>
                <div>
                        <div className="deposit">
                            <a href="/home">
                                <Button variant="outline-secondary">Back</Button>{' '}
                            </a>
                            <div className="text-center justify-content-center">
                                <h4 className="text-primary">
                                    How much would you like to deposit?
                                </h4>
                                <p>
                                    Please enter an amount you would like to deposit. The maxium amount you <br></br> can deposit is shown below
                                </p>
                                <form>
                                    <Form.Group className="mb-3" controlId="exampleForm.ControlInput1">
                                        <Form.Label>Avaliable in deposit</Form.Label>
                                        <Form.Control type="Number" placeholder="Amount" className="w-25"/>
                                    </Form.Group>
                                </form>
                            </div>
                        </div>
                        
                </div>
            </>
        )
    }
}
